// App.js
import React, { useState } from 'react';
import Navbar from './Components/Navbar/Navbar';
import Hero from './Components/Hero/Hero';
import Program from './Components/Programs/Program';
import Title from './Components/Title/Title';
import About from './Components/About/About';
import Campus from './Components/Campus/Campus';
import Feedback from './Components/Feedback/Feedback';
import Contact from './Components/Contact/Contact';
import Footer from './Components/Footer/Footer';
import VideoPlayer from './Components/VideoPlayer/VideoPlayer';
import LoginSignup from './Components/LoginSignup/LoginSignup'; // Import LoginSignup component

const App = () => {
  const [playState, setPlayState] = useState(false);
  const [showLogin, setShowLogin] = useState(false); // State to manage visibility of login page

  return (
    <div>
      <Navbar setShowLogin={setShowLogin} /> {/* Pass setShowLogin function to Navbar */}
      <Hero />
      <div className='container'>
        <Title subTitle='Our Program' title='What We Offer' />
        <Program />
        <About setPlayState={setPlayState} />
        <Title subTitle='Gallery' title='University Photos' />
        <Campus />
        <Title subTitle='Feedback' title='What Students Says ' />
        <Feedback />
        <Title subTitle='Contact Us' title='Get in Touch ' />
        <Contact />
        <Footer />
      </div>
      <VideoPlayer playState={playState} setPlayState={setPlayState} />
      {showLogin && <LoginSignup />} {/* Render LoginSignup component when showLogin is true */}
    </div>
  );
}

export default App;
